# 5_mathemagical
def mathemagical():
    strs = input()
    length = len(strs)
    sum = 0

    for i in range(length):
        num = ''
        for j in range(length):
            if i == j:
                continue
            num += strs[j]
        sum += int(num)
        if i == length - 1:
            print("+", "%*d" % (length-1, int(num)))
        else:
            print(" ", "%*d" % (length-1, int(num)))
    print("=" * (length+1))
    print("%*d" % (length+1, sum))


